function BBP.StarterChoice()
    StaticPopupDialogs["BBP_STARTER_CHOICE"] = {
        text = "Do you want the nameplates to have the Classic or Retail style?",
        button1 = "Classic",
        button2 = "Retail",
        OnAccept = function()
            BBP.StarterProfile("Classic")
        end,
        OnCancel = function ()
            BBP.StarterProfile("Retail")
        end,
        timeout = 30,
        whileDead = true,
        hideOnEscape = true,
    }
    if BBP.IntroMessageWindow then
        BBP.IntroMessageWindow:SetAlpha(0.5)
    end
    StaticPopup_Show("BBP_STARTER_CHOICE")
end

